import './App.css';

/*Componentes */
import Buscador from './componentes/Buscador';
import NavBar from './componentes/NavBar';
import PropiedadHome from './componentes/PropiedadHome';

/*JSONs */
import dataProps from "./data.json";

function App() {
  return (
    <div className='App'>
      <div className='contenedor-principal'>
        <NavBar />
        <img
          className='imagen-principal'
          src={require(`./images/casaSlider.jpg`)}
          alt='Foto de Slider'
          />
        <Buscador />
        <div className='container'>
          {dataProps.map(
            (dataProp) => {
              console.log("Propiedad:"+ dataProp);
              <PropiedadHome 
              nombre={dataProp.nombre}
              direccion={dataProp.direccion}
              />
            }
          )}
        <PropiedadHome
          nombre='CAJARAVILLE 3394 PB, CARAPACHAY, VICENTE LOPEZ'
          direccion='Cajaraville 3394 PB, Carapachay, Vicente Lopez'
          imagen='casa'
          precio='750 USD'
          expensas='30 USD'
          operacion='ALQUILER'
          ambientes ='3'
          metros='150'
          />

          <PropiedadHome
          nombre='AVELLANEDA 2500, OLIVOS, VICENTE LOPEZ'
          direccion='Avellaneda 2500, Olivos, Vicente Lopez'
          imagen='casa2'
          precio='310.000 USD'
          expensas='30 USD'
          operacion='VENTA'
          ambientes ='4'
          metros='150'
          />
        </div>
      </div>
    </div>
  );
}

export default App;
